// src/App.js

import React, { useState } from 'react';
import CameraCapture from './components/CameraCapture';

function App() {
  const [type, setType] = useState();
  return (
    <div className="App">
      <h1 style={{textAlign:"center", background:"black", color:"white", padding:"24px"}}>Biometric System</h1>
      <div style={{display:"flex", flexDirection:"column", gap:"24px", padding:"60px"}}>
      <button style={{border:"1px solid transparent", color:"white", background:"green", padding:"8px 16px"}}>Register face</button>
      <button style={{border:"1px solid green", color:"green", background:"white", padding:"8px 16px"}}>Register face</button>

      </div>
      <CameraCapture />
    </div>
  );
}

export default App;
